import React from "react";

const Rank = (props) =>{
     const {name, entries} = this.props;
    return(
    <div>
       <div className="white f3">
            {name ||', your current rank is...'}
       </div>
       <div className="white f1">
            {'#'||entries}
       </div>
    </div>
    )
}
export default Rank;
